    // MARK: - test_initWithRawValueWithWhitespaces

    func test_initWithRawValueWithWhitespaces() {
        XCTAssertEqual(GestaltDictionaryKey(rawValue: "NXJOYK7VhNn" + "7ugbF2kx0zg "), GestaltDictionaryKey.key3GProximityCapability, "String with trailing spaces should be handled.")
        XCTAssertEqual(GestaltDictionaryKey(rawValue: " NXJOYK7VhNn" + "7ugbF2kx0zg"), GestaltDictionaryKey.key3GProximityCapability, "String with leading spaces should be handled.")
    }

    // MARK: - test_initWithRawValueWithEmptyString

    func test_initWithRawValueWithEmptyString() {
        XCTAssertNil(GestaltDictionaryKey(rawValue: ""), "Empty string should return nil.")
        XCTAssertNil(GestaltDictionaryKey(rawValue: " "), "String with only spaces should return nil.")
    }

    // MARK: - test_initWithRawValueOutOfRange

    func test_initWithRawValueOutOfRange() {
        let rawValueTooShort = GestaltDictionaryKey(rawValue: "obfuscated/" + "+Cool+/Key")
        XCTAssertNil(rawValueTooShort, "Expected to be nil as it is shorter than the minimum length of 22 characters.")

        let rawValueTooLong = GestaltDictionaryKey(rawValue: "obfuscated/" + "+Cool+/Key--")
        XCTAssertNil(rawValueTooLong, "Expected to be nil as it is longer than the maximum length of 22 characters.")
    }

    // MARK: - test_equatable

    func test_equatable() {
        // swiftformat:disable all
        let key3GProximityCapability        = GestaltDictionaryKey.key3GProximityCapability
        let key3GProximityCapabilityFromRaw = GestaltDictionaryKey(rawValue: "NXJOYK7VhNn" + "7ugbF2kx0zg")
        // swiftformat:enable all
        XCTAssertEqual(key3GProximityCapability, key3GProximityCapabilityFromRaw, "Expected to be equal as they both represent the key '86GizkmSK+Ix * gCtUMOp2NA' in MobileGestalt.plist.")

        // swiftformat:disable all
        let unknownKey        = GestaltDictionaryKey.unknown("obfuscated/" + "+Cool+/Key-")
        let unknownKeyFromRaw = GestaltDictionaryKey(rawValue: "obfuscated/" + "+Cool+/Key-")
        // swiftformat:enable all
        XCTAssertEqual(unknownKey, unknownKeyFromRaw, "Expected to be equal as they both represent the key 'obfuscated/ * +Cool+/Key-' in MobileGestalt.plist.")
    }
